89f6c8801b312788f1d6d32ff3092a5a922bf96f:
query AskCollection($collectionName: String!, $query: String!) {
  askCollection(collectionName: $collectionName, query: $query)
}

072f19d8835c6ef25fdf4c1356fcedd7619e3a3c:
query GetInvestingEntities {
  getInvestingEntities {
    address
    entityType
    id
    name
    strategy
    users {
      email
      id
    }
  }
}

4002f115e69f61d0c00e201e3f361c4b26093802:
mutation UpsertInvestingEntity($input: UpsertInvestingEntityInput!) {
  upsertInvestingEntity(input: $input) {
    address
    entityType
    id
    name
    strategy
  }
}

0a27981a10d30b675861cf4860071b67399ae2cf:
mutation UpsertUser($email: String!, $id: String!) {
  upsertUser(user: {email: $email, id: $id}) {
    email
    id
  }
}

3bf78ce8cf2e3dab13639c1e43733cf05a0f3ee8:
query GetUser($id: ID!) {
  getUser(id: $id) {
    investingEntities {
      name
      address
      entityType
      strategy
      id
    }
    email
    id
  }
}
